Ugy92KJ3NzOMOiEwAkx4AaABAg	I have written two version: Iterative and Recursive version, someone who is in dout can have a look.\npackage sort;\n\n\n/**\n * The efficiency of MergeSort is not good at processing small data sets\n * When we have small datasets to be sorted, maybe we can try bubble sort or insertion sort\n * Complexity: O(nlogn)\n */\npublic class MergeSort {\n    /**\n     * O(nlogn)\n     * Iterative Version\n     *\n     * @param array\n     * @return\n     */\n    public static void twoWayMergeSortIterative(int[] array) {\n        int[] middle = array.clone();\n        for (int footStep = 2; footStep < 2 * array.length; footStep *= 2) {\n            for (int i = 0; i < array.length; i += footStep) {\n                int startPointer = i;\n                int middlePointer = i + footStep / 2;\n                int endPointer = i + footStep;\n                if (endPointer > array.length) {\n                    endPointer = array.length;\n                }\n                twoWayMergeSortIterative0(array, middle, startPointer, middlePointer, endPointer);\n            }\n            swap(array, middle);\n        }\n    }\n\n\n    /**\n     * Recursive Version\n     * Complexity: O(nlogn)\n     * @param array\n     */\n    public static void twoWayMergeSortRecursive(int[] array) {\n        int[] temp = array.clone();\n        twoWayMergeSortRecursive0(array, temp, 0, array.length);\n    }\n\n\n    public static void twoWayMergeSortRecursive0(int[] array, int[] temp, int start, int end) {\n        int middle = (end - start) / 2 + start;\n        if (middle == start) {\n            return;\n        }\n        twoWayMergeSortRecursive0(array, temp, start, middle);\n        twoWayMergeSortRecursive0(array, temp, middle, end);\n        int firstFinger = start;\n        int secondFinger = middle;\n        int rownum = start;\n        while (true) {\n            if (firstFinger >= middle || secondFinger >= end) {\n                break;\n            }\n            if (array[firstFinger] < array[secondFinger]) {\n                temp[rownum] = array[firstFinger];\n                firstFinger++;\n                rownum++;\n            } else if (array[secondFinger] < array[firstFinger]) {\n                temp[rownum] = array[secondFinger];\n                secondFinger++;\n                rownum++;\n            }\n        }\n        for (int i = firstFinger; i < middle; i++) {\n            temp[rownum] = array[i];\n            rownum++;\n        }\n        for (int i = secondFinger; i < end; i++) {\n            temp[rownum] = array[i];\n            rownum++;\n        }\n        System.arraycopy(temp, start, array, start, end - start);\n    }\n\n\n    private static void swap(int[] computeArray, int[] middle) {\n        System.arraycopy(middle, 0, computeArray, 0, computeArray.length);\n    }\n\n\n    /**\n     * After sort, swap two arrays\n     *\n     * @param src\n     * @param desc\n     * @param startPointer\n     * @param middlePointer\n     * @param endPointer\n     */\n    public static void twoWayMergeSortIterative0(int[] src, int[] desc, int startPointer, int middlePointer, int endPointer) {\n        int firstFinger = startPointer;\n        int secondFinger = middlePointer;\n        int rownum = startPointer;\n        if (middlePointer < src.length) {\n            for (int i = startPointer; i < middlePointer; i++) {\n                if (src[firstFinger] < src[secondFinger]) {\n                    desc[rownum] = src[firstFinger];\n                    firstFinger++;\n                    rownum++;\n                    if (firstFinger >= middlePointer) {\n                        break;\n                    }\n                } else {\n                    desc[rownum] = src[secondFinger];\n                    secondFinger++;\n                    rownum++;\n                    if (secondFinger >= endPointer) {\n                        break;\n                    }\n                }\n            }\n        } else {\n            middlePointer = src.length;\n        }\n        for (int i = firstFinger; i < middlePointer; i++) {\n            desc[rownum] = src[i];\n            ++rownum;\n        }\n        for (int i = secondFinger; i < endPointer; i++) {\n            desc[rownum] = src[i];\n            ++rownum;\n        }\n    }\n\n\n    public static void main(String[] args) {\n        int[] testArray = new int[]{100, 90, 5, 4, 3, 2, 1};\n        //Recursive\n//        twoWayMergeSortRecursive(testArray);\n        //Iterative\n        twoWayMergeSortIterative(testArray);\n        for (int i = 0; i < testArray.length; i++) {\n            System.out.println(testArray[i]);\n        }\n    }\n}	1	Frio Hao	6pV2IF0fgKY	2020-01-22 13:56:53	2020-01-22 13:56:53	neutral	0.5220893162632836	0.4779106837367164	0.7339653824317262	written two version iter recurs version someon dout look packag sort effici mergesort good process small data set small dataset sort mayb tri bubbl sort insert sort complex onlogn public class mergesort onlogn iter version param array return public static void twowaymergesortiterativeint array int middl array clone int footstep 2 footstep 2 array length footstep 2 int 0 array length footstep int startpoint int middlepoint footstep 2 int endpoint footstep endpoint array length endpoint array length twowaymergesortiterative0array middl startpoint middlepoint endpoint swaparray middl recurs version complex onlogn param array public static void twowaymergesortrecursiveint array int temp array clone twowaymergesortrecursive0array temp 0 array length public static void twowaymergesortrecursive0int array int temp int start int end int middl end start 2 start middl start return twowaymergesortrecursive0array temp start middl twowaymergesortrecursive0array temp middl end int firstfing start int secondfing middl int rownum start true firstfing middl secondfing end break arrayfirstfing arraysecondfing temprownum arrayfirstfing firstfing rownum els arraysecondfing arrayfirstfing 