Ugx1ZtdjT8A91tmt5NJ4AaABAg	Thank you!  Python:\n\n\n\n\ndef Merge(A):\n    '''\n    https://www.youtube.com/watch?v=4VqmGXwpLqc&list=PL9xmBV_5YoZOZSbGAXAPIq1BeUf4j20pl&index=4\n\n\n\n\n    Complexity: O(nlogn)\n    '''\n    def merge(a, b):\n        c = []\n\n\n\n\n        while len(a) > 0 and len(b) > 0:\n            if a[0] > b[0]:\n                print(f" comparison: {a[0]} > {b[0]}")\n                c.append(b[0])\n                b.pop(0)\n            else:\n                print(f" comparison: {a[0]} < {b[0]}")\n                c.append(a[0])\n                a.pop(0)\n\n\n\n\n        while len(b) > 0:\n            c.append(b[0])\n            b.pop(0)\n\n\n\n\n        while len(a) > 0:\n            c.append(a[0])\n            a.pop(0)\n\n\n\n\n        if len(c) == 2: print(f" join leafs: A={c}")\n        else: print(f" join branch: A={c}")\n        return c\n\n\n\n\n    def mergesort(A):\n        '''\n        To understand this function, comment out the return.\n        '''\n        if len(A) == 1:\n            print(f" leaf found: {A}")\n            return A\n        a = A[:int(len(A)/2)]\n        b = A[int(len(A)/2):]\n        print(f" branch: {A}")\n        print(f" branching: {a}, {b}")\n\n\n\n\n        a = mergesort(a)\n        b = mergesort(b)\n        return merge(a,b)\n\n\n\n\n    print(f"Starting Array: {A}\\n")\n    A = mergesort(A)\n    print(f"\\n Result: {A}\\n")	0	jsteezeful	4VqmGXwpLqc	2019-10-16 01:43:52	2019-10-16 01:43:52	neutral	0.36473632695495795	0.635263673045042	0.8064501499787258	thank python def mergea httpswww youtub comwatch v4vqmgxwplqc listpl9xmbv5yozozsbgaxapiq1beuf4j20pl index4 complex onlogn def mergea b c lena 0 lenb 0 a0 b0 printf comparison a0 b0 c appendb0 b pop0 els printf comparison a0 b0 c appenda0 pop0 lenb 0 c appendb0 b pop0 lena 0 c appenda0 pop0 lenc 2 printf join leaf ac els printf join branch ac return c def mergesorta understand function comment return lena 1 printf leaf found return aintlena2 b aintlena2 printf