Generics in Java	In a nutshell, generics enable types (classes and interfaces) to be parameters when defining classes, interfaces and methods.\nMuch like the more familiar formal parameters used in method declarations, type parameters provide a way for you to re-use the same code with different inputs.\nThe difference is that the inputs to formal parameters are values, while the inputs to type parameters are types.\n\nCode that uses generics has many benefits over non-generic code:\n- Stronger type checks at compile time.\nA Java compiler applies strong type checking to generic code and issues errors if the code violates type safety. \nFixing compile-time errors is easier than fixing runtime errors, which can be difficult to find.\n- Elimination of casts.\n- Enabling programmers to implement generic algorithms.\nBy using generics, programmers can implement generic algorithms that work on collections of different types, can be customized, and are type safe and easier to read.\n\nIn this video we will see :\n- What is Generics\n- What is Type-safe Language\n- How to achieve type safety\n- An example or program of Generics implementation in Java\n\nCheck out our website: http://www.telusko.com\n\nFollow Telusko on Twitter: https://twitter.com/navinreddy20\n\nFollow on Facebook: \nTelusko : https://www.facebook.com/teluskolearnings\nNavin Reddy : https://www.facebook.com/navintelusko\n\nFollow Navin Reddy on Instagram: https://www.instagram.com/navinreddy20\n\nSubscribe to our other channel:\nNavin Reddy : https://www.youtube.com/channel/UCxmkk8bMSOF-UBF43z-pdGQ?sub_confirmation=1\nTelusko Hindi :\nhttps://www.youtube.com/channel/UCitzw4ROeTVGRRLnCPws-cw?sub_confirmation=1	186129	1933	131	0	91	XMvznsY02Mk	UC59K-uG2A5ogwIrHw4bmlEg	Telusko	Generics	medium	https://youtube.com/watch?v=XMvznsY02Mk	nutshel gener enabl type class interfac paramet defin class interfac method much like familiar formal paramet use method declar type paramet provid way reus code differ input diffe