Java Generics Tutorial - 053	At some point you've likely heard about Java generics. Generics were introduced into the Java language in Java 5. In the next few videos, we're going to take a deep dive into what generics are, how to use them, and ultimately how to create our own Java generics.\n\nA generic is a class that acts like a template for creating classes. In this case, we define how the list works without stating what classes the list holds. We'll have add and remove methods, but we won't say what class we're adding and removing until we define the instance. Once we instantiate our class, we'll tell it the type our list works with. No other type is allowed. Using a generic class gives us type safety.\n\n#java #programming #tutorial #generics\n\n▼\nLike the video? Don't forget to subscribe! ➜ http://www.deegeu.com/subscribe\n\n▼\nKeep up to date with the newsletter! ➜ http://www.deegeu.com/newsletter/\n\n▼\nTranscript ➜ http://www.deegeu.com/java-generics-tutorial/ ‎\n\nConcepts: Java generics, Java\n\nSocial Links: Don't hesitate to contact me if you have any further questions.\nWEBSITE : dj@deegeu.com\nTWITTER : http://www.twitter.com/deege\nFACEBOOK: https://www.facebook.com/deegeu.programming.tutorials\nGOOGLE+ : http://google.com/+Deegeu-programming-tutorials\n\nAbout Me: http://www.deegeu.com/about-programming-tutorial-videos/\n\nRelated Videos:\nhttps://www.youtube.com/playlist?list=PLZlGOBonMjFWI_JOcZQJURzVZvaSWcA8m\n\nMedia credits:  All images are owned by DJ Spiess or used under CC0 unless listed below\n\nAirport Lounge - Disco Ultralounge by Kevin MacLeod is licensed under a Creative Commons Attribution license (https://creativecommons.org/licenses/by/4.0/)\nSource: http://incompetech.com/music/royalty-free/index.html?isrc=USUAN1100806\nArtist: http://incompetech.com/	10869	258	8	0	28	1tKmzQh8g5E	UCBy9lNSc8YxE0ggzVQCby2g	Deege U	Generics	medium	https://youtube.com/watch?v=1tKmzQh8g5E	point youv like heard java gener gener introduc java languag java 